import React from 'react';


function Header() {
  return (
    <footer className='social-logo'>
      <img src={require('../Social-logotipos/icons8-twitter-48.png')} />
      <img src={require('../Social-logotipos/icons8-linkedin-48.png')} />
      <img src={require('../Social-logotipos/icons8-instagram-48.png')} />
    </footer>
  );
}

export default Header;
